export default {
    API_URI: process.env.NODE_ENV === 'production'
        ? 'https://jsonplaceholder.typicode.com'
        : 'https://jsonplaceholder.typicode.com',
    SOCKETS_URI: process.env.NODE_ENV === 'production'
        ? 'wss://dogecodes-chat-api.herokuapp.com/'
        : 'ws://localhost:8000/',
};
